function getStorageConfig() {
  const baseUrl = ENV.forgeApiUrl;
  const apiKey = ENV.forgeApiKey;
  if (!baseUrl || !apiKey) {
    throw new Error(
      "Storage proxy credentials missing: set BUILT_IN_FORGE_API_URL and BUILT_IN_FORGE_API_KEY"
    );
  }
  return { baseUrl: baseUrl.replace(/\/+$/, ""), apiKey };
}
function buildUploadUrl(baseUrl, relKey) {
  const url2 = new URL("v1/storage/upload", ensureTrailingSlash(baseUrl));
  url2.searchParams.set("path", normalizeKey(relKey));
  return url2;
}
function ensureTrailingSlash(value) {
  return value.endsWith("/") ? value : `${value}/`;
}
function normalizeKey(relKey) {
  return relKey.replace(/^\/+/, "");
}
function toFormData(data, contentType, fileName) {
  const blob = typeof data === "string" ? new Blob([data], { type: contentType }) : new Blob([data], { type: contentType });
  const form = new FormData();
  form.append("file", blob, fileName || "file");
  return form;
}
function buildAuthHeaders(apiKey) {
  return { Authorization: `Bearer ${apiKey}` };
}
async function storagePut(relKey, data, contentType = "application/octet-stream") {
  const { baseUrl, apiKey } = getStorageConfig();
  const key = normalizeKey(relKey);
  const uploadUrl = buildUploadUrl(baseUrl, key);
  const formData = toFormData(data, contentType, key.split("/").pop() ?? key);
  const response = await fetch(uploadUrl, {
    method: "POST",
    headers: buildAuthHeaders(apiKey),
    body: formData
  });
  if (!response.ok) {
    const message = await response.text().catch(() => response.statusText);
    throw new Error(
      `Storage upload failed (${response.status} ${response.statusText}): ${message}`
    );
  }
  const url2 = (await response.json()).url;
  return { key, url: url2 };
}

// server/services/agromonitoring.ts
var AGRO_BASE_URL = "https://api.agromonitoring.com/agro/1.0";
function getApiKey() {
  const apiKey = ENV.agromonitoringApiKey || process.env.AGROMONITORING_API_KEY;
  if (!apiKey) {
    throw new Error("AGROMONITORING_API_KEY n\xE3o configurada");
  }
  return apiKey;
}
function isAgromonitoringConfigured() {
  return !!(ENV.agromonitoringApiKey || process.env.AGROMONITORING_API_KEY);
}
async function createPolygon(name, coordinates) {
  const apiKey = getApiKey();
  const closedCoords = [...coordinates];
  if (closedCoords[0][0] !== closedCoords[closedCoords.length - 1][0] || closedCoords[0][1] !== closedCoords[closedCoords.length - 1][1]) {
    closedCoords.push(closedCoords[0]);
  }
  const response = await fetch(`${AGRO_BASE_URL}/polygons?appid=${apiKey}`, {
    method: "POST",
    headers: {
      "Content-Type": "application/json"
    },
    body: JSON.stringify({
      name,
      geo_json: {
        type: "Feature",
        properties: {},
        geometry: {
          type: "Polygon",
          coordinates: [closedCoords]
        }
      }
    })
  });
  if (!response.ok) {
    const error46 = await response.text();
    console.error("Agromonitoring createPolygon error:", error46);
    throw new Error(`Erro ao criar pol\xEDgono: ${response.status}`);
  }
  return response.json();
}
async function getCurrentNdvi(polygonId) {
  const apiKey = getApiKey();
  const response = await fetch(
    `${AGRO_BASE_URL}/ndvi?polyid=${polygonId}&appid=${apiKey}`
  );
  if (!response.ok) {
    if (response.status === 404) {
      return null;
    }
    throw new Error(`Erro ao buscar NDVI atual: ${response.status}`);
  }
  const data = await response.json();
  return Array.isArray(data) ? data[0] : data;
}
function convertBoundariesToCoordinates(boundaries) {
  let points;
  if (typeof boundaries === "string") {
    points = JSON.parse(boundaries);
  } else {
    points = boundaries;
  }
  if (!Array.isArray(points) || points.length < 3) {
    throw new Error("Boundaries inv\xE1lidos: m\xEDnimo 3 pontos necess\xE1rios");
  }
  return points.map((p) => {
    if (Array.isArray(p)) {
      return [p[0], p[1]];
    }
    const lng = p.lng ?? p.lon ?? 0;
    const lat = p.lat ?? 0;
    return [lng, lat];
  });
}
async function syncFieldNdvi(field) {
  if (!isAgromonitoringConfigured()) {
    throw new Error("Agromonitoring API n\xE3o configurada");
  }
  if (!field.boundaries) {
    console.warn(`Campo ${field.id} n\xE3o tem pol\xEDgono definido`);
    return false;
  }
  try {
    let polygonId = field.agroPolygonId;
    if (!polygonId) {
      const coordinates = convertBoundariesToCoordinates(field.boundaries);
      const polygon = await createPolygon(field.name, coordinates);
      polygonId = polygon.id;
      await updateFieldAgroPolygonId(field.id, polygonId);
      console.log(`Pol\xEDgono ${polygonId} criado para campo ${field.id}`);
    }
    const ndviData2 = await getCurrentNdvi(polygonId);
    if (ndviData2 && ndviData2.data) {
      const ndviValue = Math.round(ndviData2.data.mean * 100);
      const ndviMin = Math.round(ndviData2.data.min * 100);
      const ndviMax = Math.round(ndviData2.data.max * 100);
      const cloudCoverage = Math.round(ndviData2.cl);
      await updateFieldNdvi(field.id, ndviValue, polygonId);
      await createNdviHistory({
        fieldId: field.id,
        userId: field.userId,
        ndviValue,
        ndviMin,
        ndviMax,
        cloudCoverage,
        satellite: ndviData2.source || "Sentinel-2",
        acquisitionDate: new Date(ndviData2.dt * 1e3)
      });
      console.log(`NDVI ${ndviValue / 100} sincronizado para campo ${field.id}`);
      return true;
    } else {
      console.warn(`Sem dados NDVI dispon\xEDveis para campo ${field.id}`);
      await updateFieldNdvi(field.id, field.currentNdvi || 0, polygonId);
      return true;
    }
  } catch (error46) {
    console.error(`Erro ao sincronizar NDVI do campo ${field.id}:`, error46);
    throw error46;
  }
}
async function syncAllFieldsNdvi(fields2) {
  let success2 = 0;
  let failed = 0;
  for (const field of fields2) {
    try {
      const result = await syncFieldNdvi(field);
      if (result) {
        success2++;
      } else {
        failed++;
      }
    } catch (error46) {
      console.error(`Erro ao sincronizar campo ${field.id}:`, error46);
      failed++;
    }
    await new Promise((resolve) => setTimeout(resolve, 1100));
  }
  return { success: success2, failed };
}

